import React from 'react'
import Navbar from '../Components/Navbar/Navbar'
import "./home.scss"

const Home = () => {
  return (
    <div className='home'>

     <Navbar/>
     <img src="https://images.unsplash.com/photo-1626814026160-2237a95fc5a0?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80" alt="" />
    </div>
  )
}

export default Home
